
// Auto-generated payment script (address-only QR with pre-baked images)

const ADDRS = {
  "usdt_bep20": { token: "USDT", net: "BEP-20 / BNB Smart Chain", address: "0x31b03ffBE63301DA4aF6D3E79bb2e08Cb188824C" },
  "usdt_erc20": { token: "USDT", net: "ERC-20 / Ethereum",        address: "0x31b03ffBE63301DA4aF6D3E79bb2e08Cb188824C" },
  "usdt_trc20": { token: "USDT", net: "TRC-20 / TRON",            address: "TEKyiqoVedxU9iVGBrCHkFEukYNPPiX3fj" },
  "usdc_erc20": { token: "USDC", net: "ERC-20 / Ethereum",        address: "0x31b03ffBE63301DA4aF6D3E79bb2e08Cb188824C" }
};

const QR_IMG = {
  "usdt_bep20": "data:image/png;base64,",
  "usdt_erc20": "data:image/png;base64,",
  "usdt_trc20": "data:image/png;base64,",
  "usdc_erc20": "data:image/png;base64,"
};

(function() {
  const qs = new URLSearchParams(location.search);
  const centsParam = qs.get("id");
  const cents = /^\d+$/.test(centsParam || "") ? parseInt(centsParam, 10) : 0;
  const dollars = (cents / 100).toFixed(2);

  const $ = (s) => document.querySelector(s);
  const amountLabel = $("#amountLabel");
  const amtText = $("#amtText");
  const addrBox = $("#addr");
  const qrImg = $("#qrImg");
  const netLabel = $("#netLabel");
  const tokenNote = $("#tokenNote");

  function select(key){
    document.querySelectorAll(".segbtn").forEach(btn=>{
      btn.setAttribute("aria-pressed", String(btn.dataset.net === key));
    });
    const c = ADDRS[key];
    addrBox.textContent = c.address;
    netLabel.textContent = c.net;
    tokenNote.textContent = `Token: ${c.token}`;
    qrImg.setAttribute("src", QR_IMG[key]);
    qrImg.setAttribute("alt", `${c.token} address QR (${c.net})`);
  }

  function copyFrom(selector){
    const el = document.querySelector(selector);
    const text = el ? el.textContent.trim() : "";
    if(!text) return;
    navigator.clipboard.writeText(text).then(()=>{
      const btn = document.querySelector(`.btn[data-copy="${selector}"]`);
      if(btn){ const t=btn.textContent; btn.textContent="Copied!"; setTimeout(()=>btn.textContent=t,1100); }
    }).catch(()=>{});
  }

  function init(){
    amountLabel.textContent = `$${dollars}`;
    amtText.textContent = `$${dollars}`;
    document.querySelectorAll(".segbtn").forEach(btn=>{
      btn.addEventListener("click", ()=> select(btn.dataset.net));
    });
    document.querySelectorAll(".btn[data-copy]").forEach(btn=>{
      btn.addEventListener("click", ()=> copyFrom(btn.getAttribute("data-copy")));
    });
    select("usdt_bep20");
  }

  if (document.readyState === "loading") {
    document.addEventListener("DOMContentLoaded", init);
  } else {
    init();
  }
})();
